import csv

s=""

prot_string = ""
table = []

with open("table_codon_to_aa.csv") as csvfile:
    reader = csv.reader(csvfile,delimiter=";")
    for row in reader:
        table.append(row)

def codon_to_aa(codon):
    for couple in table:        
        if codon == couple[0]:            
            if couple[1]=="Stop":
                return ""
            return couple[1]
i=0
for k in range(len(s)):
    codon = s[i:i+3]
    i+=3
    aa = codon_to_aa(codon)
    if len(aa)<1:
        break
    prot_string+=aa
    
print(prot_string)